import React from 'react'
import "./Board.css"
import Box from "./Box"
const Board = ({
    board
}) => {
    return ( 
    <div> {
            board.map((value, idx) => {
                return <Box value = {
                    value
                }
                onclick = {
                    () => {
                        onclick(idx);
                    }
                }
                />
            })
        }

        </div>
    )
}

export default Board
